import base64
import sys

data = ""

# Fix padding
while len(data) % 4 != 0:
    data += "="

try:
    decoded = base64.b64decode(data)
    print(f"Decoded length: {len(decoded)}")
    with open("/Users/fernandosouza/Documents/Projetos/MyFoil/build_error.png", "wb") as fh:
        fh.write(decoded)
    print("File written successfully.")
except Exception as e:
    print(f"Error: {e}")
    sys.exit(1)
